import React, { Component } from 'react'
import { TextField } from 'material-ui'

export default class Navbar extends Component {
    render() {
        return (
            <div id="navbar">
              <TextField
                  name="username"
                    floatingLabelText="user name"
                    value={user.username}
                    onChange={onChange}
                    errorText={errors.username}
              />
              <TextField
                  name="password"
                    floatingLabelText="user name"
                    value={user.username}
                    onChange={onChange}
                    errorText={errors.username}
              />
            </div>
        )
    }
}
